import React from "react";
import Siderbar from "../inc/siderbar";

export default function Dashboard() {
  return (
    <div>
      <div className="dashboard-container">
        <Siderbar />
        <h2>RÉGLAGES ET UTILISATEURS</h2>
        <input type="text" placeholder="Nhập chữ bất kỳ" />
      </div>
    </div>
  );
}
